export function add01(a: number, b: number): number {
  return a + b;
}

export function subtract01(a: number, b: number): number {
  return a - b;
}

export function multiply01(a: number, b: number): number {
  return a * b;
}

export function divide01(a: number, b: number): number {
  return a / b;
}
